import React from "react"
import Filmovi from "./Filmovi"
import $ from "jquery" 

class Bioskop extends React.Component{
    constructor(){
        this.handleClick=this.handleClick.bind(this)
    }
    
    handleClick(){
        $('#Filmovi').hide()
    }

    render(){
        return(
        <div>
            <Filmovi id="Filmovi"/>
            <button onClick={handleClick()}>Novi film</button>
        </div>
    )}
}

export default Bioskop
